import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
    Button, Card, CardTitle, Col, Row
} from 'reactstrap';


export default function Pregunta(props) {

    return (

        <Row>

                {props.preguns.map((pregunta, index) => (
                    <Col sm="6">
                    <Card
                        key={index}
                        body
                        className="my-2"
                        style={{
                            width: '20rem'
                        }}
                    >
                        <CardTitle tag="h5">
                            {pregunta.texto}
                        </CardTitle>
                        <br />
                        {pregunta.respuestas.map((respuesta, index) => (
                            <><Button key={index} color='primary'>{respuesta.respuesta}</Button>&nbsp;</>
                        ))}
                    </Card>
                    </Col>
                ))}



        </Row>
    );
}
